import React from 'react';
import logo from './logo.svg';
import './App.css';
import ButtonAppBar from './components/ButtonAppBar';
import BasicTextFields from './components/BasicTextFields';

function App() {
  return (
    <div className="App">
      <ButtonAppBar />
      <BasicTextFields />
    </div>
  );
}

export default App;
